import React from 'react'

type Props = {
  setSituation :React.Dispatch<React.SetStateAction<string>>
}

const OorK:React.FC<Props> = ({setSituation}) => {
  const handleChange = (e: React.ChangeEvent<HTMLSelectElement>) => {
    // console.log(e.target.value)
    setSituation(e.target.value);
  }
  return (
    <>
        <div className="mx-2 "><h5>O or K</h5></div>
        <select name="example" onChange={(e) => handleChange(e)} className="col-10 col-sm-3">
            <option value="-">-</option>
            <option value="Kick Off">Kick Off</option>
            <option value="Offense">Offense</option>
            <option value="Punt">Punt</option>
            <option value="FG">FG</option>
            <option value="TFP">TFP</option>
        </select>
    </>
  )
}

export default OorK
